import { Form, Input, Button, Card } from 'antd';
import { useCallback } from 'react';

const PostCard = ({ post }) => {
   return (
       <div>
           <Card
                cover={post.Images[0] && <PostImages images={post.Images} />}
           >
               <Image />
               <Content />
               <Button></Button>
           </Card>
           <CommentForm />
           <Comments />
       </div>
   )
}

export default PostCard;
